import React from "react";
import {Nav, NavDropdown, Form, Navbar, Container} from 'react-bootstrap';
import { Link } from "react-router-dom";
//import "./AppBar.css"


const AppBar = (props) => {

    const menu = (
        <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link style={{marginLeft: 20}}/>
                </Nav>
                <Nav variant={"right"} >
                    <Nav.Item bsPrefix={'nav-link'}><Link to={"/deals/"}>Translate</Link></Nav.Item>
                    <Nav.Item bsPrefix={'nav-link'}><Link to={"/events/"}>Readers</Link></Nav.Item>
                    <Nav.Item bsPrefix={'nav-link'}><Link to={"/services/"}>Settings</Link></Nav.Item>
                </Nav>

              </Navbar.Collapse>
    ) ;

    return (
        <Container fluid style={{backgroundColor: "#F0F0FF", paddingLeft: 20, paddingRight:40}}>
            <Navbar style={{textColor: "#000000", paddingLeft: 20, paddingRight:40, }}>
                <Navbar.Brand href="/"><strong>Snowden</strong></Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />

                { menu }

            </Navbar>
        </Container>
            )

}


export default AppBar;
